import React from "react";

const NAV_MENU = [
  { id: "1", name: "Шашлык" },
  { id: "1", name: "Шаурма" },
];

function NavMenu() {
  const navMenu = NAV_MENU.map((nav) => <div>{nav.name}</div>);
  return <div>{navMenu}</div>;
}

export default NavMenu;
